import React from 'react';
import NavBar from '../components/Navbar/NavBar';
import Footer from '../components/Footer';

const Gallery = () => {
    const videos = [
        'https://www.youtube.com/embed/dQw4w9WgXcQ', // Replace with your video URLs
        'https://www.youtube.com/embed/3JZ_D3ELwOQ',
        'https://www.youtube.com/embed/tgbNymZ7vqY',
        'https://www.youtube.com/embed/2Vv-BfVoq4g',
        'https://www.youtube.com/embed/L_jWHffIx5E',
    ];

    return (
        <>
            <NavBar />
            <div className="bg-black text-sky-500 py-12">
                <h1 className="text-center text-4xl font-bold uppercase mb-8">Video Gallery</h1>
                <div className="container mx-auto px-4 grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
                    {videos.map((video, index) => (
                        <div key={index} className="overflow-hidden rounded-lg shadow-lg">
                            <iframe
                                className="w-full h-64"
                                src={video}
                                title={`YouTube video ${index + 1}`}
                                frameBorder="0"
                                allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                                allowFullScreen
                            ></iframe>
                        </div>
                    ))}
                </div>
            </div>
            <Footer />
        </>
    );
};

export default Gallery;
